/// The WordBreak attribute for Unicode code-points.
#[derive(Debug,Clone,Copy,PartialEq)]
pub enum WordBreak {
    N = 0,
    Other = 1,
    Lf = 2,
    Newline = 3,
    Cr = 4,
    WSegSpace = 5,
    DoubleQuote = 6,
    SingleQuote = 7,
    MidNum = 8,
    MidNumLet = 9,
    Numeric = 10,
    MidLetter = 11,
    ALetter = 12,
    ExtendNumLet = 13,
    Format = 14,
    Extend = 15,
    HebrewLetter = 16,
    Zwj = 17,
    Katakana = 18,
    RegionalIndicator = 19,
}

/// Get the WordBreak attribute for a Unicode code-point.
///
/// # Arguments
///  - `code_point` A code-point in the form of a rust `char`.
///
/// # Returns
/// A WordBreak attribute of the Unicode code-point.
#[must_use] pub const fn get_word_break(code_point: char) -> WordBreak
{
    const INDEX_MASK : usize = (1 << WORD_BREAK_INDEX_BITS) - 1;
    const COLUMN_MASK : usize = (1 << WORD_BREAK_COLUMN_BITS) - 1;

    let code_point_value = code_point as usize;
    let code_point_lo = code_point_value % WORD_BREAK_CHUNK_SIZE;
    let mut code_point_hi = code_point_value / WORD_BREAK_CHUNK_SIZE;
    if code_point_hi > WORD_BREAK_INDEX_LEN - 1 {
        code_point_hi = WORD_BREAK_INDEX_LEN - 1;
    }

    let index_offset = code_point_hi * WORD_BREAK_INDEX_BITS;
    let index_byte_offset = index_offset / 8;
    let index_bit_offset = index_offset % 8;
    let mut index: usize = 0;
    index |= (WORD_BREAK_DATA[WORD_BREAK_INDEX_BYTE_OFFSET + index_byte_offset + 1] as usize) << 8;
    index |= (WORD_BREAK_DATA[WORD_BREAK_INDEX_BYTE_OFFSET + index_byte_offset + 0] as usize) << 0;
    index >>= index_bit_offset;
    index &= INDEX_MASK;

    let column_offset = (index * WORD_BREAK_CHUNK_SIZE + code_point_lo) * WORD_BREAK_COLUMN_BITS;
    let column_byte_offset = column_offset / 8;
    let column_bit_offset = column_offset % 8;

    let mut value: usize = 0;
    value |= (WORD_BREAK_DATA[column_byte_offset + 1] as usize) << 8;
    value |= (WORD_BREAK_DATA[column_byte_offset + 0] as usize) << 0;
    value >>= column_bit_offset;
    value &= COLUMN_MASK;

    return match value {
        0 => WordBreak::N,
        1 => WordBreak::Other,
        2 => WordBreak::Lf,
        3 => WordBreak::Newline,
        4 => WordBreak::Cr,
        5 => WordBreak::WSegSpace,
        6 => WordBreak::DoubleQuote,
        7 => WordBreak::SingleQuote,
        8 => WordBreak::MidNum,
        9 => WordBreak::MidNumLet,
        10 => WordBreak::Numeric,
        11 => WordBreak::MidLetter,
        12 => WordBreak::ALetter,
        13 => WordBreak::ExtendNumLet,
        14 => WordBreak::Format,
        15 => WordBreak::Extend,
        16 => WordBreak::HebrewLetter,
        17 => WordBreak::Zwj,
        18 => WordBreak::Katakana,
        19 => WordBreak::RegionalIndicator,
        _ => WordBreak::N,
    };
}

